."X_0" <= 1.500000) THEN 121 ELSE 122 END ELSE 80 END END END END END END END ELSE CASE WHEN (model_input."X_7" <= 8.500000) THEN CASE WHEN (model_input."X_2" <= 4.500000) THEN 7 ELSE CASE WHEN (model_input."X_2" <= 7.500000) THEN 53 ELSE 54 END END ELSE CASE WHEN (model_input."X_2" <= 4.500000) THEN 9 ELSE CASE WHEN (model_input."X_3" <= 0.500000) THEN CASE WHEN (model_input."X_2" <= 9.500000) THEN CASE WHEN (model_input."X_0" <= 7.500000) THEN CASE WHEN (model_input."X_5" <= 4.500000) THEN CASE WHEN (model_input."X_7" <= 9.500000) THEN CASE WHEN (model_input."X_0" <= 0.500000) THEN 35 ELSE CASE WHEN (model_input."X_1" <= 6.500000) THEN CASE WHEN (model_input."X_0" <= 6.000000) THEN CASE WHEN (model_input."X_2" <= 5.500000) THEN CASE WHEN (model_input."X_1" <= 5.000000) THEN 51 ELSE 52 END ELSE CASE WHEN (model_input."X_1" <= 5.000000) THEN 55 ELSE CASE WHEN (model_input."X_2" <= 6.500000) THEN 57 ELSE CASE WHEN (model_input."X_2" <= 8.000000) THEN 59 ELSE 60 END END END END ELSE CASE WHEN (model_input."X_2" <= 5.500000) THEN 45 ELSE CASE WHEN (model_input."X_2" <= 6.500000) THEN 47 ELSE 48 END END END ELSE CASE WHEN (model_input."X_0" <= 2.500000) THEN 39 ELSE CASE WHEN (model_input."X_1" <= 7.500000) THEN 41 ELSE 42 END END END END ELSE 34 END ELSE 28 END ELSE 26 END ELSE CASE WHEN (model_input."X_5" <= 2.500000) THEN CASE WHEN (model_input."X_0" <= 0.500000) THEN CASE WHEN (model_input."X_1" <= 7.500000) THEN 19 ELSE 20 END ELSE CASE WHEN (model_input."X_1" <= 2.500000) THEN 21 ELSE CASE WHEN (model_input."X_1" <= 3.500000) THEN 23 ELSE CASE WHEN (model_input."X_5" <= 0.500000) THEN CASE WHEN (model_input."X_7" <= 9.500000) THEN 31 ELSE 32 END ELSE 30 END END END END ELSE 16 END END ELSE 12 END END END END AS node_id
